#include <time.h>
using namespace std;

class Solution {
public:

	bool initCheck(const char *s, const char *p) {  
		int l1 = 0;  
		int idx = 0, l2 = 0;  

		while (s[l1] != '\0') {  
			l1++;  
		}  
		while (p[idx] != '\0') {  
			l2 += p[idx++] != '*' ? 1 : 0;  
		}  

		return l1 >= l2;  
	}  

	bool isMatch_others(const char *s, const char *p) {  
		// Start typing your C/C++ solution below  
		// DO NOT write int main() function  
		if (!initCheck(s, p)) {  
			return false;  
		}   

		int l = 0;  
		while (p[l++] != '\0');  


		bool prev[l], f[l];  
		memset(f, false, sizeof(bool) * l);  
		memset(prev, false, sizeof(bool) * l);  

		bool isFirst = true;  
		for (int i = 0; i < l; i++) {  
			if (p[i] == '*') {  
				f[i] = i == 0 || f[i - 1];  
			}             
			else if ((p[i] == '?' || p[i] == *s) && isFirst) {  
				isFirst = false;  
				f[i] = true;  
			}  
			else {  
				break;  
			}  
		}  
		s++;  

		while (*(s - 1) != '\0') {  
			memcpy(prev, f, l);  
			memset(f, false, sizeof(bool) * l);  

			for (int i = 0; i < l; i++) {  
				if (prev[i]) {  
					f[i] = f[i] || p[i] == '*';  
					f[i + 1] = f[i + 1] || p[i + 1] == '?' || p[i + 1] == *s;  
				}  
				else if (i == 0 || f[i - 1]) {  
					f[i] = f[i] || p[i] == '*';  
				}  
			}  
			s++;  
		}     

		return f[l - 1];  
	} 

	bool isMatch(const char *s, const char *p) {
		int len_s = strlen(s);
		int len_p = strlen(p);
		if (0==len_p*len_s)
		{
			if ('\0' == *s && '\0' == *p)
			{
				return true;
			}
			if ('*' == *s)
			{
				s++;
				return isMatch(s, p);
			}
			if ('*' == *p)
			{
				p++;
				return isMatch(s, p);
			}
			return false;
		}
		vector<bool> dp1(len_p, false);
		vector<bool> dp2(len_p, false);
		if ('*' == *s)
		{
			for (int j = 0; j < len_p; ++j)
			{
				dp1[j] = true;
			}
		}
		else if (*s == *p || '?' == *s || '?' == *p || '*' == *p)
		{
			dp1[0] = true;
		}
		vector<bool> &last = dp1;
		vector<bool> &current = dp2;

		for (int i = 1; i < len_s; ++i)
		{
			if ('*' == *p || (last[0] && '*'==s[i]))
			{
				current[0] = true;
			}
			for (int j = 1; j < len_p; ++j)
			{
				if (((last[j]||current[j-1]) && ('*'==p[j]||'*'==s[i])) || (last[j-1] && ('?'==s[i]||'?'==p[j]||s[i]==p[j])))
				{
					current[j] = true;
				}
				else
				{
					current[j] = false;
				}
			}
			vector<bool> &tmp = last;
			last = current;
			current = tmp;
		}
		return last[len_p-1];
	}

	bool isMatch_recursion(const char *s, const char *p) {
		if ('\0' == *s && '\0' == *p)
		{
			return true;
		}
		if ('*' == *s)
		{
			return asteriskMatch(s, p);
		}
		if ('*' == *p)
		{
			return asteriskMatch(p, s);
		}
		if (*s == *p || '?' == *s || '?' == *p)
		{
			s++;
			p++;
			return isMatch(s, p);
		}
		else
		{
			return false;
		}
	}
private:
	bool asteriskMatch(const char *asterisk, const char *p)
	{
		asterisk++;
		if ('*' == *asterisk)
		{
			return asteriskMatch(asterisk, p);
		}
		while (*p != '\0')
		{
			if (isMatch(asterisk, p))
			{
				return true;
			}
			p++;
		}
		if ('\0' == *asterisk && '\0' == *p)
		{
			return true;
		}
		return false;
	}
};
